import React from 'react';
import TodoItem from './TodoItem';

function TodoList({ todos, onDelete, onEdit }) {
  return (
    <ul>
      {todos.map((todo, index, newText) => (
        <TodoItem key={index} todo={todo} onDelete={() => onDelete(index)} newText={todo} onEdit={() => onEdit(newText)} />
      ))}
    </ul>
  );
}

export default TodoList;
